window.App=window.App||{},App.Views=App.Views||{},App.Views.ImageLoader=Backbone.Events.extend({initialize:function(e){var i=e.imgs;this.numThumbs=i.length,this.queue=[],this.numLoaded=0;for(var s=0;s<this.numThumbs;s++){var n=new App.Views.ImageView({el:i[s],id:s});n.once("load",this.onThumbLoaded,this),this.queue.push(n)}},onThumbLoaded:function(e){this.numLoaded++,e.el.classList.add("img-"+this.numLoaded),this.numLoaded===this.numThumbs?this.trigger("progress:complete"):this.trigger("progress:change",this.numLoaded)}});